"use strict";

module.exports = function (app) {
  var Documento = app.db.models.documentos;
  var Cliente = app.db.models.clientes;
  var Proveedor = app.db.models.proveedores;
  var Tipodocumento = app.db.models.tipodocumentos; // get documento

  app.get('/documentos', function (req, res) {
    Cliente.findAll({
      attributes: ['cliente_id', 'cliente_nombre']
    }).then(function (result) {
      return Proveedor.findAll({
        attributes: ['proveedor_id', 'proveedor_nombre']
      }).then(function (result2) {
        return Tipodocumento.findAll({
          attributes: ['tipodocumento_id', 'tipodocumento_nombre']
        }).then(function (result3) {
          return Documento.findAll({
            attributes: ['documento_id', 'tipodocumento_id', 'documento_tipoclipro', 'cliente_id', 'proveedor_id', 'documento_nro', 'documento_feccrea', 'documento_pago', 'documento_pagoTotal', 'documento_contenido', 'documento_feccan'],
            include: [{
              model: Cliente,
              attributes: ['cliente_id', 'cliente_nombre']
            }, {
              model: Proveedor,
              attributes: ['proveedor_id', 'proveedor_nombre']
            }, {
              model: Tipodocumento,
              attributes: ['tipodocumento_id', 'tipodocumento_nombre']
            }]
          }).then(function (result4) {
            return res.json([result, result2, result3, result4]);
          });
        });
      });
    }).catch(function (error) {
      res.status(412).json({
        msg: error.message
      });
    });
