			.then(
				result1 => Cliente.findAll({ attributes: ['cliente_id', 'cliente_nombre', 'cliente_apepat', 'cliente_apemat', 'cliente_dniruc'], where: {cliente_estado: 1}, order:[['cliente_nombre', 'ASC']] })
