	// 		)
	// 	)
	// 	.catch(error => { res.status(412).json(req.body) }) 
	// });

	// add viaje
	app.post('/viajes', (req, res) => {
      // console.log("======>> " + req.body.cliente_id + "\n")
		if(!req.body.cliente_id)
		{
			res.status(400)
			console.log("ERROR POST")
			res.json(req.body)
		}
		else
		{
			Viaje.create(req.body)
			.then( () => { 
				res.send('Viaje Agregado')
			})
			.catch(err => { 
				res.send('error: ' + err)
			})
		}
	});

	// update viaje
